import React,{useEffect,useState} from "react";
import { View, Text, StyleSheet, FlatList, Image } from "react-native";
import Header from "../schedule/Header";
import { useNavigation } from "@react-navigation/native"; // Import the useNavigation hook
import axios from "axios";
import myURL from "../../../services/myurls";
import { useRoute } from "@react-navigation/native";

const Completed = () => {
  const route = useRoute();
  let user = route.params?.user;
  const navigation = useNavigation(); // Initialize the navigation object
    const [data,setResData] = useState([]);

    
  const getpendingAppointment = () => {
    axios
      .get(`${myURL}/user/scheduleAppointment/completed/?my_ID=${user}`)
      .then((res) => {
        console.log("match User ID" + res.data);
        setResData(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  };

  useEffect(()=>{
    getpendingAppointment();
  },[])


  const handleBackButton = () => {
    navigation.goBack(); // Navigate back
  };

  return (
    <View style={styles.container}>
      <Header
        icon={require("../../src/images/backbutton.png")}
        title={"Completed Appointments"}
        navigation={navigation} // Pass the navigation prop
      />
      <View>
        <FlatList
          data={data}
          renderItem={({ item, index }) => {
            return (
              <View style={styles.itemView}>
                <Image
                  source={require("../../src/images/vac.png")}
                  style={styles.docImage}
                />
                <View>
                  <Text style={styles.name}>{item.selectedVaccine}</Text>
                  <Text style={styles.timing}>{item.currentTime} AM</Text>
                </View>
                <Text style={styles.status}>{"Completed"}</Text>
              </View>
            );
          }}
        />
      </View>
    </View>
  );
};

export default Completed;

const styles = StyleSheet.create({
  container: {
    flex: 1,
  },
  itemView: {
    width: "94%",
    height: 100,
    borderRadius: 10,
    borderWidth: 0.5,
    alignSelf: "center",
    marginTop: 10,
    flexDirection: "row",
    alignItems: "center",
  },
  docImage: {
    width: 60,
    height: 60,
    borderRadius: 30,
    marginLeft: 10,
  },
  name: {
    fontSize: 18,
    fontWeight: "600",
    marginLeft: 20,
  },
  timing: {
    fontSize: 16,
    marginLeft: 20,
    marginTop: 5,
  },
  status: {
    marginLeft: 60,
    borderRadius: 10,
    backgroundColor: "#f2f2f2",
    padding: 5,
    color: "green",
  },
});
